import React from 'react';

import Wrapper from '../UI/Wrapper';
import { Grid } from '@mui/material';
import BusinessIcon from '@mui/icons-material/Business';
import theme from '../UI/Theme';

const ApplicationForm = () => {
  return (
    <Wrapper>
      <Grid 
        container 
        columnSpacing={12} 
        direction="row" 
        sx={{
        paddingLeft: "7%", 
        paddingRight: "7%",
        paddingTop: "5%",
        paddingBottom: "5%",
        }}>
        <Grid container item direction="column" xs={12} md={4}>
          <Grid item>
            <h2>Ad eos saepe lucilius, noster postulant philosophia ea usu, qui dicta sadipscing te.</h2>
          </Grid>
          <Grid item>
            <BusinessIcon />
            <p>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum.</p>
          </Grid>
          <Grid item>
            <BusinessIcon />
            <p>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum.</p>
          </Grid>
        </Grid>
        <Grid 
          container 
          item
          xs={12} 
          md={8} 
          spacing={2}
          sx={{
            [theme.breakpoints.down("md")]: {
            marginLeft: "auto",
            marginRight: "auto"
            }
          }}>
          <Grid item xs={12} md={12} sx={{paddingLeft: "0px"}}>
          <h2>FORTUNE <br/> 500</h2>
          </Grid>
          <Grid item xs={12} md={6}>

          </Grid>
        </Grid>     
      </Grid>
    </Wrapper>
  )
};

export default ApplicationForm;
